import { useDispatch, useSelector } from "react-redux";
import { agregarBusqueda, actualizarBusqueda } from "./acciones";
import { useEffect } from "react";
import "./App.css"
import BuscadorArea from "./buscador";



function App() {

  const dispatch = useDispatch()
  const datosBusqueda = useSelector(estado => estado.reductorBusqueda.contenidoBusqueda)
  const busquedaResultado = useSelector(estado => estado.reductorBusqueda.termino)




  return (
    <div className="App">
      <BuscadorArea />
      <h1>Buscador de Imagenes</h1>

      <div className="row">
        {datosBusqueda.map((dato) => (<div key={dato.id} className="col-4 mb-2 mt-2 rounded float-left"><img src={dato.previewURL} alt={"Foto realizada por:  " + dato.user} /></div>))}
      </div>
    </div>
  );
}

export default App;
